import './gamekeyboard.css'
import Keyboardrow from './Keyboardrow'

function Gamekeyboard({ lines, answer, onClick, className }) {
  return (
    <div className={`keyboard ${className}`}>
      <Keyboardrow
        letters="qwertyuiop"
        onClick={onClick}
        lines={lines}
        answer={answer}
      />
      <Keyboardrow
        letters="asdfghjkl"
        onClick={onClick}
        lines={lines}
        answer={answer}
      />
      <Keyboardrow
        letters="qzxcvbnm"
        onClick={onClick}
        lines={lines}
        answer={answer}
      />
    </div>
  )
}

export default Gamekeyboard
